        styr::ConstBranchPtr<std::vector<MissingET>> _met;
        
        styr::BranchPtr<std::vector<Particle>> _jetNominal;
        styr::BranchPtr<std::vector<Particle>> _jetJecUp;
        styr::BranchPtr<std::vector<Particle>> _jetJecDown;
        
        styr::BranchPtr<std::vector<Particle>> _metNominal;
        styr::BranchPtr<std::vector<Particle>> _metJecUp;
        styr::BranchPtr<std::vector<Particle>> _metJecDown;
        styr::BranchPtr<std::vector<Particle>> _metUnclUp;
        styr::BranchPtr<std::vector<Particle>> _metUnclDown;

    public:
        JetMetUncertainty():
            styr::Module("")
        {
        }
        
        virtual void beginFile(const TFile*,styr::Event& event) override
        {
            
            _jets = event.getBranch<std::vector<Jet>>(config().get<std::string>("jetSrc"));
            _met = event.getBranch<std::vector<MissingET>>(config().get<std::string>("metSrc"));
            
            _jetNominal = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_jetNominal");
            _jetJecUp = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_jetJecUp");
            _jetJecDown = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_jetJecDown");
            
            _metNominal = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_metNominal");
            _metJecUp = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_metJecUp");
            _metJecDown = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_metJecDown");
            _metUnclUp = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_metUnclUp");
            _metUnclDown = event.createBranch<std::vector<Particle>>(config().get<std::string>("output")+"_metUnclDown");
        }
        
        
        
        virtual bool analyze(styr::Event&, bool) override
        {
            const std::vector<Jet>& jets = _jets->get();
            Particle met = _met->get()[0];
            met.P4().SetPxPyPzE(met.P4().Px(), met.P4().Py(), 0.0, std::sqrt(met.P4().Px()*met.P4().Px()+met.P4().Py()*met.P4().Py()));
            
            float metPx_jecUp = met.P4().Px();
            float metPy_jecUp = met.P4().Py();
            
            float metPx_jecDown = met.P4().Px();
            float metPy_jecDown = met.P4().Py();
            
            float metPx_clustered = 0.;
            float metPy_clustered = 0.;
            
            for (size_t i = 0; i < _jets->size(); ++i)
            {
                _jetNominal->get().push_back(jets[i]);
                
                metPx_clustered-=jets[i].P4().Px();
                metPy_clustered-=jets[i].P4().Py();
                
                Particle jetJecUp = jets[i];
                Particle jetJecDown = jets[i];
                float unc = getUncertainty(jets[i].P4().Eta(),jets[i].P4().Pt());
                
                jetJecUp.P4()*=(1.+unc);
                jetJecDown.P4()*=(1.-unc);
                
                metPx_jecUp+=jets[i].P4().Px()*unc;
                metPy_jecUp+=jets[i].P4().Py()*unc;
                
                metPx_jecDown-=jets[i].P4().Px()*unc;
                metPy_jecDown-=jets[i].P4().Py()*unc;
                
                _jetJecUp->get().push_back(jetJecUp);
                _jetJecDown->get().push_back(jetJecDown);
            }
            
            _metNominal->get().push_back(met);
            
            Particle metJecUp = met;
            Particle metJecDown = met;
            metJecUp.P4().SetPxPyPzE(metPx_jecUp, metPy_jecUp, 0.0, std::sqrt(metPx_jecUp*metPx_jecUp+metPy_jecUp*metPy_jecUp));
            metJecDown.P4().SetPxPyPzE(metPx_jecDown, metPy_jecDown, 0.0, std::sqrt(metPx_jecDown*metPx_jecDown+metPy_jecDown*metPy_jecDown));
            
            _metJecUp->get().push_back(metJecUp);
            _metJecDown->get().push_back(metJecDown);
            
            Particle metUnclUp = met;
            Particle metUnclDown = met;
            
            float metPx_unclUp = (met.P4().Px()-metPx_clustered)*1.1+metPx_clustered;
            float metPy_unclUp = (met.P4().Py()-metPy_clustered)*1.1+metPy_clustered;
            
            float metPx_unclDown = (met.P4().Px()-metPx_clustered)*0.9+metPx_clustered;
            float metPy_unclDown = (met.P4().Py()-metPy_clustered)*0.9+metPy_clustered;
            
            metUnclUp.P4().SetPxPyPzE(metPx_unclUp, metPy_unclUp, 0.0, std::sqrt(metPx_unclUp*metPx_unclUp+metPy_unclUp*metPy_unclUp));
            metUnclDown.P4().SetPxPyPzE(metPx_unclDown, metPy_unclDown, 0.0, std::sqrt(metPx_unclDown*metPx_unclDown+metPy_unclDown*metPy_unclDown));

            _metUnclUp->get().push_back(metUnclUp);
            _metUnclDown->get().push_back(metUnclDown);
            
            
            return true;
        }        
        
        virtual ~JetMetUncertainty()
        {
        }
